
USE osae;

CREATE TABLE `osae_images` (
  `image_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `image_data` longblob NOT NULL,
  `image_name` varchar(45) NOT NULL,
  `image_type` varchar(4) NOT NULL,
  PRIMARY KEY (`image_id`)
) ENGINE=InnoDB AUTO_INCREMENT=257 DEFAULT CHARSET=latin1$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `osae_sp_image_add`(
IN  pimage_data         LONGBLOB,
IN  pimage_name			VARCHAR(45),
IN  pimage_type			VARCHAR(4)
)
BEGIN

	INSERT INTO `osae`.`osae_images`
		(`image_data`,		
		`image_name`,
		`image_type`)
		VALUES
		(
		pimage_data,		
		pimage_name,
		pimage_type
		);
END$$

LOCK TABLES `osae_images` WRITE;
/*!40000 ALTER TABLE `osae_images` DISABLE KEYS */;
